(1159, 1, 0, 9, 14, 'embed', NULL, 'Gaiking Movie Teaser Trailer', 'While watching the Gaiking trailer on Youtube, I noticed a bunch of comments asked if this was real. Yes, it sure is. This to me looks more like it’ll take at least another year or so to complete. So don’t expect this movie to come out until late 2013 or even 2014. Unless they decide to turn this into a B rated movie, then it can possibly be out straight to DVD  in the summer of 2013. Well at least the trailer looks promising. As a robot anime fanboy, I can’t wait to see this. I”m thinking we’ll see more studios pick up the rights to robot anime and make movie series out of them.', 387, 0.0, 0, 0, '1', '2012-10-02 11:10:28'),
