(1400, 1, 0, 1102, 16, 'embed', NULL, 'Peter Bjorn and John - Young Folk', 'Please keep in mind that this is used, circa 1965 "Scotch Recording Tape", so please excuse any tape drop outs caused by a the occasional bad spot on the tape. Recording was made at 7½ I.p.s. (Inches per second). Recording source was from a 192kbps MP3 file from my computer, through my Onkyo Wavio SE-U33GXV USB external sound card to the Teac A-4010s reel to reel. Then played back from the reel to reel, back through the Wavio, and finally to my computer. Recorded using Audacity @ 24bit/48,000 Hz.\r\n\r\nExported from Sony Vegas in MP4 format with the following settings:\r\nAudio: 320kbps, 48,000 Hz, 24 Bit, Stereo\r\nVideo: 29.970 fps, 1440x1080 Progressive, 12 Mbps', 452, 0.0, 0, 0, '1', '2012-11-25 00:33:56'),
