(1646, 1, NULL, 1104, 12, 'embed', NULL, 'Life in a Day Trailer', 'What happens when you send a request out to the world to chronicle, via video, a single day on Earth? You get 80,000 submissions and 4,500 hours of footage from 192 countries. Producer Ridley Scott and Oscar-winning director Kevin Macdonald took this raw material — all shot on July 24, 2010 — and created Life in a Day, a groundbreaking, feature-length documentary that portrays this kaleidoscope of images we call life. National Geographic is bringing it to theaters starting July 24, 2011. Prepare to be amazed.', 127, NULL, NULL, 0, '1', '2012-10-22 12:23:25'),
