(1860, 1, NULL, 9, 16, 'embed', NULL, 'Firefox AK - Color The Trees', 'Firefox AK - Color The Trees\r\n\r\nIt is not hard to imagine these songs travelling through Europe. How they were given birth in Berlin''s colourful melting pot of expressions and impressions by Andrea Kellerman''s alter ego Firefox AK. How they danced all the way to the Swedish borders and were embraced by the Nordic melancholy. In Stockholm they were introduced to indiepop guru and producer Andreas Mattsson (Popsicle, Hello Saferide) who refined and made the good sound even better. When the songs returned to Andrea it was like Christmas Eve every time. "He got it right again", she stated soon after the music landed on her floor.', 112, NULL, NULL, 0, '1', '2012-11-02 22:42:03'),
