(1867, 1, 0, 9, 14, 'embed', NULL, 'La Luna - Pixar s Short Movie', 'La Luna is the timeless. Fable of a young boy coming of age in the most peculiar circumstances. Tonight is the very first time his Papa and Grandpa are taking him to work. In an old wooden boat they row far out to sea, and with no land in sight, they stop and wait. A big surprise awaits the little boy as he discovers his family''s most unusual line of work. Should he follow the example of his Papa or his Grandpa? Will he be able to find his own way amidst their conflicting opinions and timeworn traditions?\r\n\r\n''La Luna'' A Pixar short that will play before "Brave" in theaters.', 294, 0.0, 0, 0, '1', '2012-11-07 09:15:10'),
