(1979, 1, 0, 9, 12, 'embed', NULL, '10 Surprising Health Benefits of Playing Video Games', '10 Surprising Health Benefits of Playing Video Games\r\n\r\nWant the reactions of a fighter pilot? How about the precision of a surgeon? Then you maybe need to spend more time on the computer. Presenting 10 surprising health benefits of playing video games.\r\n\r\nThe music is Red Dwarf by Desert Planet', 175, 0.0, 0, 0, '1', '2012-11-18 22:41:25'),
(1980, 1, NULL, 9, 14, 'embed', NULL, 'The Monk and the Monkey', 'The Monk and the Monkey - An Adventurous 3D Animation short film\r\n\r\nA young boy named Ragu wishes to become a monk. His mentor sends him on a mission to retrieve a sacred fruit in order to prove his readiness. He travels far to reach the old tree that bears the fruit, only to encounter a monkey who steals it away from him. He chases the monkey, and finds himself faced with a difficult dilemma.\r\n', 147, NULL, NULL, 0, '1', '2012-11-19 08:58:38'),
(1981, 1, NULL, 9, 14, 'embed', NULL, 'The Chase 3D short animation', 'Fantastic 3D animated short by Space Patrol in France. Great examples of character animation, lighting, rendering, VFX, dynamics!!! WOW!!\r\n\r\nPhilippe Gamer, the director on this moving animated film for Pain Without Borders, is back with another fantastic short, "The Chase," created in 3D CG. The personal project, made out of his production company Space Patrol in France, shows some lovely ladies on one hell of a thrill ride. But you don''t know how truly aweome they are until you see the finale.\r\n\r\nAlthough the female daredevils Nissans, it''s not a Nissan film. The cars were actually repurposed from a 3D print campaign his company had previously worked on.', 155, NULL, NULL, 0, '1', '2012-11-19 09:17:20'),
(1982, 1, NULL, 9, 14, 'embed', NULL, 'The Cathedral - Short Animated Films', 'The film is based on a short story by Jacek Dukaj under the same title. In 2002 "Cathedral" was awarded the main prize at SIGGRAPH festival ("Best Animated Short"). A year later it received an Oscar nomination in the category "Best Animated Short Film".\r\n\r\nSYNOPSIS:\r\nStory of a pilgrim who comes to the Cathedral on the border of the known world. He wants to find answers. He finds tranquility.\r\n\r\nDIRECTOR: Tomasz Bagiński\r\nYEAR OF PRODUCTION: 2002', 185, NULL, NULL, 0, '1', '2012-11-19 10:57:08'),
