(2015, 1, NULL, 1, 14, 'embed', NULL, 'Love Like Aliens  short animation', 'Winner of the Special Jury Prize, Asian Film Festival Dallas.\r\n\r\nLove Like Aliens 3D animated short produced in Tokyo, Japan.\r\n\r\nCreated by entertainment industry veteran and filmmaker Rashad Haughton, six and half minute animated short brings to life the iconic works of legendary artist and gynoid creator Sorayama Hajime in a way never before seen in film.\r\n\r\nIn a future not too far from now, humanity has advanced to a point where the line between Homo Sapiens and Androids have blurred completely. This has occurred so that the species could survive. Technology has allowed humans to travel into deep space to colonize other planets and galaxies deep in the universe because Earth has become uninhabitable. One of the many unfortunate results of this robotic Darwinism is that human behavior and consciousness has also changed over the years. Much of what makes one human -- love, family, intimacy etc., have all become things of the past. Almost legend...', 184, NULL, NULL, 0, '1', '2012-11-24 12:28:33'),
