(2028, 1, NULL, 1104, 11, 'embed', NULL, 'The End of Twilight', 'Well folks, this is it. The big one. The moment so many of us have been waiting for. It''s officially time say goodbye to the legendary "vampire" franchise but unlike "Harry Potter" which was indeed a hard series to let go of, "Twilight" is pretty damn easy given that it is has produced some of the worst cinema over the past four years since it began. \r\n\r\nNote to the fans: Sure there are many fans around the world who love the series and all the power to them and if you are a fan of the films, good for you and hopefully you see this video as just good fun.\r\n\r\nHowever this particular video is a celebration for all those like myself who are thrilled to see it finally gone and for various reasons, many of which are stated in the video. A franchise which will forever live in infamy, "Twilight" officially comes to an end so enjoy our special tribute to its farewell.\r\n\r\nMusic: "End Credits" from the "Dragonheart" soundtrack. Conducted by Randy Edelman.', 155, NULL, NULL, 0, '1', '2012-11-27 12:51:55'),
