(2278, 1, 0, 9, 12, 'embed', NULL, 'NASA Raining Loops on the Sun', 'On July 19, 2012, an eruption occurred on the sun that produced a moderately powerful solar flare and a dazzling magnetic display known as coronal rain. Hot plasma in the corona cooled and condensed along strong magnetic fields in the region. Magnetic fields, are invisible, but the charged plasma is forced to move along the lines, showing up brightly in the extreme ultraviolet wavelength of 304 Angstroms, and outlining the fields as it slowly falls back to the solar surface. Music: "Thunderbolt" by Lars Leonhard, courtesy of artist.', 209, 0.0, 0, 0, '1', '2013-03-06 12:31:52'),
