(2356, 1, NULL, 9, 14, 'embed', NULL, 'Thor 2 The Dark World trailer ', 'The first official trailer for Thor: The Dark World - in UK cinemas Oct 30\r\n\r\nMarvel''s Thor: The Dark World continues the big-screen adventures of Thor, the Mighty Avenger, as he battles to save Earth and all the Nine Realms from a shadowy enemy that predates the universe itself. In the aftermath of Marvel''s Thor and Marvel''s Avengers Assemble,Thor fights to restore order across the cosmos...but an ancient race led by the vengeful Malekith returns to plunge the universe back into darkness. Faced with an enemy that even Odin and Asgard cannot withstand, Thor must embark on his most perilous and personal journey yet, one that will reunite him with Jane Foster and force him to sacrifice everything to save us all. ', 215, NULL, NULL, 0, '1', '2013-04-24 07:59:56'),
