(2364, 1, 0, 9, 14, 'embed', NULL, 'Almost Human Trailer FOX HD', 'From Emmy Award-winning executive producer J.J. Abrams ("Fringe," "Lost," the "Star Trek" and "Mission: Impossible" franchises) and creator/executive producer J.H. Wyman ("Fringe," "The Mexican"), comes ALMOST HUMAN. Starring Karl Urban ("Star Trek") and Michael Ealy ("Sleeper Cell," "Common Law"), the new series is an action-packed police drama set 35 years in the future, when police officers are partnered with highly evolved human-like androids. The year is 2048. Meet JOHN KENNEX (Urban), a cop who survived one of the most catastrophic attacks ever made against the police department. After waking up from a 17-month coma, he can''t remember much -- except that his partner was killed; his girlfriend, ANNA MOORE (guest star Mekia Cox, "Crazy, Stupid, Love.," "Undercovers"), left him after the attack; and he lost one of his legs and is now outfitted with a highly sophisticated synthetic appendage. Suffering from depression, mental atrophy, trauma-onset OCD, PTSD and the "psychological rejection of his synthetic body part," John returns to work at the behest of longtime ally Captain SANDRA MALDONADO (Emmy Award nominee Lili Taylor, "Six Feet Under," "Ransom"). By mandate, every cop must partner with a robot. And despite his passionate aversion to androids, John is paired up with a battle-ready MX-43. But he abruptly terminates his partnership after the robot discovers incriminating information about him. So technician RUDY LOM (Mackenzie Crook, "Pirates of the Caribbean" franchise) introduces John to DORIAN (Ealy), a discontinued android with unexpected emotional responses. Although such responses were deemed flaws, it is in these "flaws" that John relates to Dorian most. After all, John is part-machine now, and Dorian is part-human. John and Dorian''s understanding of each other not only complements them, it connects them. As he adjusts to working with his new partner, John also must learn to get along with his new colleagues, including the eager and somewhat starstruck Detective VALERIE STAHL (Minka Kelly, "Friday Night Lights," "(500) Days of Summer") and the distrustful Detective RICHARD PAUL (Michael Irby, "Law Abiding Citizen," "The Unit"), who does not welcome John back with open arms. ALMOST HUMAN will follow the week-to-week missions of John and Dorian, as they fight crime across this futuristic landscape, while the mysteries surrounding his attack and the larger mythology of this new world unfold. ALMOST HUMAN is produced by Bonanza Productions Inc. in association with Bad Robot Productions and Warner Bros. Television. The series is created by J.H. Wyman, who wrote the pilot. The series is executive-produced by J.J. Abrams, Bryan Burk and Wyman. Kathy Lingg ("Person of Interest," "Revolution," "Fringe") and Reid Shane ("Fringe") are co-executive producers. Brad Anderson ("Fringe," "The Killing") directed and served as co-executive producer on the pilot.', 310, 0.0, 0, 0, '1', '2013-05-16 08:57:41'),
