(2436, 1, NULL, 1, 15, 'embed', NULL, 'Dark Souls Trailer - Prepare to Die Edition', 'Dark Souls is the new action role-playing game  from  the  developers  who\r\nbrought you  Demon''s  Souls,  FromSoftware.  Dark  Souls  will  have  many\r\nfamiliar features:  A  dark  fantasy  universe,  tense  dungeon  crawling,\r\nfearsome enemy encounters and unique online interactions. Dark Souls is  a\r\nspiritual  successor  to  Demon''s,  not  a  sequel.  Prepare  for  a  new,\r\ndespair-inducing  world,  with  a  vast,  fully-explorable  horizon  and\r\nvertically-oriented  landforms.  Prepare  for  a  new,  mysterious  story,\r\ncentered around the the world of Lodran, but most of all, prepare to  die.\r\nYou will face countless murderous traps, countless darkly  grotesque  mobs\r\nand several gargantuan, supremely powerful demons and dragons bosses.  You\r\nmust learn from death to persist through this unforgiving world.  And  you\r\narent alone. Dark Souls allows the spirits of other players to show up in\r\nyour world, so you can learn from their deaths and  they  can  learn  from\r\nyours. You can also summon players into your world to co-op adventure,  or\r\ninvade other''s worlds to PVP battle. New to Dark Souls are Bonfires, which\r\nserve as check points as you fight your way through this  epic  adventure.\r\nWhile rested at Bonfires, your health and magic replenish but at  a  cost,\r\nall mobs respawn. Beware: There is no place in Dark Souls  that  is  truly\r\nsafe. With days of game play and an even more punishing difficulty  level,\r\nDark Souls will be the most deeply challenging game you  play  this  year.\r\nCan you live through a million deaths and earn your legacy?', 191, NULL, NULL, 0, '1', '2013-09-07 15:20:41'),
