(2563, 1, NULL, 1, 12, 'embed', NULL, 'The Cubli - a cube that can jump up, balance, and walk', 'The Cubli is a 15 × 15 × 15 cm cube that can jump up and balance on its corner. Reaction wheels mounted on three faces of the cube rotate at high angular velocities and then brake suddenly, causing the Cubli to jump up. Once the Cubli has almost reached the corner stand up position, controlled motor torques are applied to make it balance on its corner. In addition to balancing, the motor torques can also be used to achieve a controlled fall such that the Cubli can be commanded to fall in any arbitrary direction. Combining these three abilities -- jumping up, balancing, and controlled falling -- the Cubli is able to ''walk''.', 82, NULL, NULL, 0, '1', '2014-01-02 02:18:49'),
(2564, 1, NULL, 1, 12, 'embed', NULL, 'The astounding athletic power of quadcopters', 'In a robot lab at TEDGlobal, Raffaello D''Andrea demos his flying quadcopters: robots that think like athletes, solving physical problems with algorithms that help them learn. In a series of nifty demos, D''Andrea show drones that play catch, balance and make decisions together -- and watch out for an I-want-this-now demo of Kinect-controlled quads.', 128, NULL, NULL, 0, '1', '2014-01-04 10:41:41'),
