(2630, 1, 0, 9, 9, 'embed', NULL, 'Angry ram attacks motorcyclist', 'I was riding my trail bike up a hill when I came across this grumpy old ram with huge horns, It charged my bike then started attacking me, surprisingly powerful animal.\r\nI Couldn\\''t turn my bike around as I was on a steep hill & if I did he would have charged me side on which could have broken my leg. This guy is known for his aggression & attacks for no reason, he\\''s even attacked a group of pig hunting dogs.﻿ In the end I had to pick up a branch & wave it in front of him, he didn\\''t like the noise & backed off enough for me to make my escape.\r\nFilmed in Nelson, New Zealand.', 48, 0.0, 0, 1, '1', '2014-04-28 15:12:45'),
