(2678, 1, 0, 1, 15, 'embed', NULL, 'Infamous Second Son Gameplay Walkthrough Part 1', 'Infamous Second Son is set seven years after the good ending of Infamous 2, in which Cole MacGrath activated the Ray Field Inhibitor (RFI) to destroy a Conduit (superhumans named for their ability to "channel" powers) named John White, also known as the Beast and cure the Plague. The explosion that resulted was originally thought to have killed all Conduits across the globe; however, those outside of the blast radius or with a natural resistance have survived. Fearing the Conduits'' abilities after the destruction of Empire City, the US eastern seaboard and the worldwide economy, the Department of Unified Protection (DUP) is formed. Now, major cities across the United States are heavily monitored for Conduit activity, whom the DUP have labeled collectively as "bio-terrorists". The game is set in Seattle, Washington, now under DUP jurisdiction. Players control Delsin Rowe, a 24 year-old slacker graffiti artist, who wants to help the community by protesting against the government, which he hates. Infamous is set in a open world setting, where the player can do as they please. Parkour is a major element and players can destroy the environment to their use. The player starts with the smoke element and obtains other powers by defeating other conduits.', 40, 0.0, 0, 0, '1', '2014-05-03 13:23:03'),
