(2828, 1, 0, 1, 14, 'embed', NULL, 'Jupiter Ascending - International Trailer', 'Jupiter Jones was born under a night sky, with signs predicting that she was destined for great things. Now grown, Jupiter dreams of the stars but wakes up to the cold reality of a job cleaning toilets and an endless run of bad breaks. Only when Caine, a genetically engineered ex-military hunter, arrives on Earth to track her down does Jupiter begin to glimpse the fate that has been waiting for her all along - her genetic signature marks her as next in line for an extraordinary inheritance that could alter the balance of the cosmos.', 0, 0.0, 0, 1, '1', '2014-09-26 22:35:29'),
(2829, 1, 0, 1, 14, 'embed', NULL, 'Kingsman The Secret Service - Trailer', 'Kingsman: The Secret Service tells the story of a super-secret spy organization that recruits an unrefined but promising street kid into the agency''s ultra-competitive training program just as a global threat emerges from a twisted tech genius.', 0, 0.0, 0, 0, '1', '2014-09-26 22:45:16'),
(2830, 1, NULL, 1, 14, 'embed', NULL, 'The Maze Runner - Official Trailer', 'When Thomas wakes up trapped in a massive maze with a group of other boys, he has no memory of the outside world other than strange dreams about a mysterious organization known as W.C.K.D. Only by piecing together fragments of his past with clues he discovers in the maze can Thomas hope to uncover his true purpose and a way to escape.', NULL, NULL, NULL, NULL, '1', '2014-09-26 22:55:34'),
