(23, 'Prestashop Test Ana', ' \r\n\r\n \r\n\r\n"Remind products" module\r\n\r\n \r\n\r\n\r\n\r\nGeneral\r\n\r\nThe exercise represents a Prestashop module implementation. The scope of this exercise is too see your capability to read and understand a basic Prestashop documentation and to perform the development required below.\r\n\r\n\r\n\r\nShort description\r\n\r\nThis module will allow users to select products that they want to be reminded about and the administrator can see the list of all reminders. \r\n\r\nA concrete business case for this feature is a printing shop that sells printer cartridges so most of the time customers are re-ordering the same products after a while (when the current cartridges were consumed). \r\n\r\n\r\n\r\nDescription\r\n\r\nOn the Front End side there will be 2 places where users can tell which are the products that they want to be reminded about and when. These places are:\r\n\r\n1. When you make an order, in the basket the customer can select (from a select box) when to be reminded about a specific product; this selection is optional so the user is not forced to select any remind periods.\r\n\r\n2. In the order history (in the user profile) for each product of an order the customer can select  when to be reminded about; as I already mentioned this selection is optional so the user is not forced to select any remind period \r\n\r\nThere will be 4 possible periods: 1 month, 3 months, 6 months, and 12 months. \r\n\r\nOn the Back End side there will be an administration page where the administrator can see the list of all reminded products and the period for every single user. Filtering of this list needs also to be set in place. The administrator can do also some basic operations:\r\n- change periods for every product and every customer\r\n- delete periods (notifications)\r\n\r\n \r\n\r\n \r\n\r\n\r\n\r\nDevelopment\r\n\r\nPlease consider that I am the customer and I want the best and complete possible feature. You can ask any kind of questions now or during the development; you can propose any kind of ideas; you can validate any kind of directions by doing mockups, flows, etc.\r\n\r\nThe implementation does not need to touch the core of the framework; the result of this implementation needs to be an installable module that I can always disable.\r\n\r\nThe development can be done in any location (your server or our server) as long as you share with us your work.\r\n\r\n\r\n\r\nSteps\r\n\r\nStep 1: Analyse the requirements of the exercise\r\n\r\nStep 2: Read Prestashop documentation\r\n\r\nStep 3: Present a working plan for this implementation and some development milestones\r\n\r\nDevelopment plan example:\r\n\r\n·         Create a new Prestashop module\r\n\r\n·         Add the select box in the Order/Basket and History templates\r\n\r\n·         …\r\n\r\nMilestones examples:\r\n\r\n·         10.09.2014: I will present you the Front End implementation but also the list of reminders in the Back End\r\n\r\n·         20.09.2014: I will present you the reminders management capabilities in the Back End\r\n\r\n·         …\r\n\r\nStep 4: Give us the pricing of your implementation\r\n\r\nStep 5: Start working\r\n\r\nStep 6: When done, share and present us the implementation you did\r\n\r\n \r\n\r\nImportant\r\n\r\nWe know that you are busy with your personal life; we do not want to overload you with this exercise so keep in mind that you can plan your work as you wish even if takes few weeks to deliver it;', '2014-11-05 22:16:51', '2014-11-05 22:16:51'),
(24, 'Prestashop Test Sergiu', '"Price steal" module\r\n\r\n\r\n\r\nGeneral\r\n\r\nThe exercise represents a Prestashop module implementation. The scope of this exercise is too see your capability to read and understand a basic Prestashop documentation and to do the development required below.\r\n\r\nShort description\r\n\r\nWe would like to create a module that is able to "steal" product prices from competitor web shops and to show to the users/customers some attractive information related to the pricing.\r\n\r\nDescription\r\n\r\nOn the Back End side you need to define a "Price template" area in which the administrator can define regular expressions that identifies the price position on the competitor websites; so, each “price template” will have 2 elements:\r\n\r\n-       name of the template (ex: emag.ro)\r\n\r\n-       input text field in which the admin can define a regular expression (or something else) that can tell to the system/logic how to identify the price on that specific competitor page\r\n\r\nYou need also to create 2 such regular expressions for 2 websites that you choose.\r\n\r\nOn the product detail level (where the administrator can edit products in the Back End panel) the administrator can add competitor links for each products; so in each product detail there will be as many “competitor input fields” as many templates where defined  and in there competitor url’s can be inserted.\r\n\r\nOn the Front End side, in the product detail page (for each product) you will show:\r\n\r\n-       a text: "We have the best price on the market. The prices of our competitors are ...."\r\n\r\n-       the list of url’s to the competitors\r\n\r\n-       for each url we will have a button “See the competitor price” and when this button is clicked a read of the competitor website is performed and the price is taken based on the added regular expression and the price is shown to the user near the url/link; this action we prefer to be done via Ajax.\r\n\r\nInfo: All these details are shown ONLY for the products that contains such competitor url’s. \r\n\r\nDevelopment\r\n\r\nPlease consider that I am the customer and I want the best and complete possible feature. You can ask any kind of questions now or during the development; you can propose any kind of ideas; you can validate any kind of directions by doing mockups, flows, etc.\r\n\r\nThe implementation does not need to touch the core of the framework; the result of this implementation needs to be an installable module that I can always disable.\r\n\r\nThe development can be done in any location (your server or our server) as long as you share with us your work.\r\n\r\n\r\nSteps\r\nStep 1: Analyse the requirements of the exercise\r\n\r\nStep 2: Read Prestashop documentation\r\n\r\nStep 3: Present a working plan for this implementation and some development milestones\r\n\r\nDevelopment plan example:\r\n\r\n·         Create a new Prestashop module\r\n\r\n·         Prepare the “Price Template” area\r\n\r\n·         Prepare the database structure for the “Price Template”\r\n\r\n·         …\r\n\r\nMilestones examples:\r\n\r\n·         10.09.2014: I will present you the “Price Template” area\r\n\r\n·         20.09.2014: I will present you the competitors links management in the product detail page in the Back End\r\n\r\n·         …\r\n\r\nStep 4: Give us the pricing of your implementation\r\n\r\nStep 5: Start working\r\n\r\nStep 6: When done, share and present us the implementation you did\r\n\r\nImportant\r\n\r\nWe know that you are busy with your personal life; we do not want to overload you with this exercise so keep in mind that you can plan your work as you wish even if takes few weeks to deliver it;', '2014-11-05 22:17:49', '2014-11-05 22:17:49'),
